function delayedExecution(){const e=document.querySelector(".welcomeback-close-btn"),t=document.querySelector(".body-container-welcomeback-model");document.addEventListener("mouseout",(function(e){e.clientY<=0&&(document.cookie.split(";").some((e=>e.trim().startsWith("seenMessage=")))||t.classList.remove("remove"))})),e.addEventListener("click",(()=>{t.classList.add("remove"),document.cookie="seenMessage=true; expires="+new Date(Date.now()+72e5).toUTCString()+"; path=/"}))}document.addEventListener("DOMContentLoaded",(function(){setTimeout(delayedExecution,6e4)}));